import React from 'react';
import { DataGrid } from '@material-ui/data-grid';
import { useDemoData } from '@material-ui/x-grid-data-generator';

const Patient_list = () =>{
    const { data } = useDemoData({
        dataSet: 'Commodity',
        rowLength: 1000,
        maxColumns: 6,
      });
    return(
        <div>
            <p>Patient_list</p>
            <DataGrid pagination {...data} />
        </div>
    )
}

export default Patient_list
